import logging
from datetime import datetime
from typing import List, Dict, Optional
from enum import Enum, auto
import json

# Logger setup for better debugging and troubleshooting
logging.basicConfig(level=logging.INFO)
logger = logging.getLogger(__name__)

# Enums for various statuses and types
class PublishStatus(Enum):
    DRAFT = auto()
    PUBLISHED = auto()
    VALIDATED = auto()
    ERROR = auto()

class SubmissionType(Enum):
    FABS = auto()
    DABS = auto()

class UserRole(Enum):
    AGENCY_USER = auto()
    BROKER_USER = auto()
    DATA_USER = auto()
    DEVELOPER = auto()
    UI_DESIGNER = auto()
    OWNER = auto()
    TESTER = auto()
    WEBSITE_USER = auto()

# Models
class User:
    def __init__(self, user_id: str, role: UserRole, name: str):
        self.user_id = user_id
        self.role = role
        self.name = name

class Submission:
    def __init__(self, submission_id: str, submission_type: SubmissionType, created_by: User):
        self.submission_id = submission_id
        self.submission_type = submission_type
        self.created_by = created_by
        self.publish_status = PublishStatus.DRAFT
        self.last_updated = datetime.now()
        self.validation_errors: List[str] = []
        self.file_path: Optional[str] = None

    def update_publish_status(self, new_status: PublishStatus):
        self.publish_status = new_status
        self.last_updated = datetime.now()
        logger.info(f"Submission {self.submission_id} status updated to {new_status.name}")

    def add_validation_error(self, error: str):
        self.validation_errors.append(error)

    def validate(self) -> bool:
        # Placeholder for validation logic
        if self.submission_type == SubmissionType.FABS:
            # Example validation: Check if file is uploaded
            if not self.file_path:
                self.add_validation_error("No file uploaded for FABS submission")
                self.update_publish_status(PublishStatus.ERROR)
                return False
        self.update_publish_status(PublishStatus.VALIDATED)
        return True

class FileHandler:
    def __init__(self):
        self.cache: Dict[str, bytes] = {}  # Simple cache for file data

    def upload_file(self, file_data: bytes, file_name: str) -> str:
        file_path = f"uploads/{file_name}"
        self.cache[file_path] = file_data
        logger.info(f"File {file_name} uploaded to {file_path}")
        return file_path

    def download_file(self, file_path: str) -> Optional[bytes]:
        return self.cache.get(file_path)

class ValidationRules:
    def __init__(self):
        self.rules: Dict[str, str] = self._load_rules()

    def _load_rules(self) -> Dict[str, str]:
        # Placeholder for loading rules from DB or config
        return {
            "FABS": "Rules for FABS validation",
            "DABS": "Rules for DABS validation"
        }

    def get_rules(self, submission_type: SubmissionType) -> str:
        return self.rules.get(submission_type.name, "No rules found")

class UIDesign:
    def __init__(self):
        self.current_designs: Dict[str, Dict] = {}

    def update_design(self, page: str, design_data: Dict):
        self.current_designs[page] = design_data
        logger.info(f"Design updated for {page}")

    def get_design(self, page: str) -> Optional[Dict]:
        return self.current_designs.get(page)

class TestingManager:
    def __init__(self):
        self.scheduled_tests: Dict[str, Dict] = {}

    def schedule_test(self, test_name: str, date: datetime, participants: List[User]):
        self.scheduled_tests[test_name] = {
            "date": date,
            "participants": [user.name for user in participants]
        }
        logger.info(f"Test {test_name} scheduled for {date}")

    def generate_report(self, test_name: str) -> Optional[Dict]:
        return self.scheduled_tests.get(test_name)

class BrokerSystem:
    def __init__(self):
        self.file_handler = FileHandler()
        self.validation_rules = ValidationRules()
        self.ui_design = UIDesign()
        self.testing_manager = TestingManager()
        self.submissions: Dict[str, Submission] = {}
        self.publish_locks: Dict[str, bool] = {}  # Prevent double publishing

    def create_submission(self, user: User, submission_type: SubmissionType) -> Submission:
        submission_id = f"{submission_type.name}_{datetime.now().strftime('%Y%m%d%H%M%S')}"
        submission = Submission(submission_id, submission_type, user)
        self.submissions[submission_id] = submission
        logger.info(f"New {submission_type.name} submission created by {user.name}")
        return submission

    def publish_submission(self, submission_id: str) -> bool:
        if submission_id in self.publish_locks and self.publish_locks[submission_id]:
            logger.warning(f"Submission {submission_id} is already being published")
            return False

        submission = self.submissions.get(submission_id)
        if not submission:
            logger.error(f"Submission {submission_id} not found")
            return False

        self.publish_locks[submission_id] = True
        try:
            if submission.validate():
                submission.update_publish_status(PublishStatus.PUBLISHED)
                logger.info(f"Submission {submission_id} published successfully")
                return True
            return False
        finally:
            self.publish_locks[submission_id] = False

    def get_fabs_files(self) -> List[Dict]:
        # Placeholder for fetching published FABS files
        return [
            {"file_id": "FABS_20230101", "published_date": "2023-01-01"},
            {"file_id": "FABS_20230102", "published_date": "2023-01-02"}
        ]

    def update_validation_rules(self, new_rules: Dict):
        self.validation_rules.rules.update(new_rules)
        logger.info("Validation rules updated")

# Example usage
if __name__ == "__main__":
    system = BrokerSystem()
    user = User("user123", UserRole.AGENCY_USER, "John Doe")

